import React from "react";
import "./styles/App.css";
import ProjectList from "./components/ProjectList";
// import NavBar from "./components/NavBar";
// import { Route, Switch } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h2>Braden's Lambda Portfolio</h2>

        <h1>A little about ME, Braden Bell</h1>
        <p class="about-me">
          1sdc0d3r designed his first basic website when he was 11 years old. He
          took a break for 10 years and decided it was time to bring back his
          talents to the world. This template is being used to create my own
          portfolio. I hope to learn a lot by studying this code!
        </p>
      </header>
      {/* <NavBar /> */}
      <ProjectList />
    </div>
  );
}

export default App;
